import React, { Component } from 'react'

export default class YoutubeVideo extends Component {
    constructor() {
        super();
        this.state = {
            videoURL: "",
            id: ""
        }
    }
    componentWillMount() {
        this.setState({ videoURL: this.props.videoURL });
        var id = "#" + this.state.videoURL;
        this.setState({ id: id });
    }
    render() {
        return (
            <div>
                <div className="storyContent" data-aos="fade-up">
                    <div className="d-flex flex-column d-lg-flex flex-lg-row align-items-center">

                        <div className="p-2 col-lg-9">
                            <div className="d-flex flex-column align-items-center">


                                <div className="p-2">
                                    <button type="button" className="btn btn-danger" data-toggle="modal" data-target={this.state.id}>
                                        Watch
                                    </button>

                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}
